import { Table } from 'react-bootstrap'

export default class register extends Component {
  render() {
    return (
      <div>
  <tbody>



        <td>{this.props.data.username}</td>
        <td>{this.props.data.email}</td>
        <td>{this.props.data.password}</td>



  </tbody>


      </div>
    )
  }
}
